tables.table_schema:
CREATE TABLE protein_interactions (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(255),
    interaction_type VARCHAR(50),
    pathway_name VARCHAR(100)
);

CREATE TABLE proteins (
  protein_id INT PRIMARY KEY,
  protein_name VARCHAR(255) NOT NULL
);

CREATE TABLE protein_interaction_data (
  protein_id SERIAL PRIMARY KEY,
  interaction_partner_id INTEGER REFERENCES protein_interaction_data(protein_id),
  interaction_type VARCHAR(50) NOT NULL,
  interaction_score FLOAT
);

CREATE TABLE biological_pathways (
  pathway_id SERIAL PRIMARY KEY,
  pathway_name VARCHAR(100) NOT NULL,
  pathway_description TEXT
);

CREATE TABLE protein_functions (
  function_id SERIAL PRIMARY KEY,
  protein_id INTEGER REFERENCES protein_interaction_data(protein_id),
  function_name VARCHAR(100) NOT NULL,
  function_description TEXT
);

CREATE TABLE Proteins (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(100),
    protein_function VARCHAR(200)
);

CREATE TABLE Pathways (
    pathway_id INT PRIMARY KEY,
    pathway_name VARCHAR(100),
    pathway_description TEXT
);

CREATE TABLE InteractionsAnnotation (
    annotation_id INT PRIMARY KEY,
    interaction_id INT,
    annotation_text TEXT
);
